  <html>
    <head>
        <meta name="viewport" content="width=device-width, initial-scale=1" />
        <style>
             @import url("https://fonts.googleapis.com/css2?family=Baloo+Paaji+2:wght@400;500&display=swap");
    body {
      font-family: 'Segoe UI', sans-serif;
      background-image: url('bg.gif');
      color: #333;
      margin: 0;
      padding: 20px;
    }
    h1 {
      text-align: center;
      color: #4c5969;
      margin-bottom: 30px;
      font-size: 4rem;
    }
    .grid {
      display: grid;
      grid-template-columns: repeat(auto-fill, minmax(290px, 1fr));
      gap: 100px;
      max-width: 800px;
      margin: auto;
      align-self: center;
      justify-self: center;
    }
    .item {
      background: #fff;
      border: 2px solid #D3EAFF;
      border-radius: 10px;
      padding: 15px;
      text-align: center;
      font-weight: bold;
      cursor: pointer;
      transition: transform 0.2s, border-color 0.2s;
      box-shadow: 0 2px 5px rgba(0,0,0,0.05);
    }
    .item:hover {
      transform: scale(1.05);
      border-color: #96CCFB;
    }
    .item img, .item .icon {
      font-size: 40px;
      margin-bottom: 5px;
      width: 256px;
      vertical-align: center;
    }
    .details {
      display: none;
      background: #ffffff;
      border: 3px solid #AAD7FF;
      border-radius: 12px;
      padding: 25px;
      margin-top: 30px;
      max-width: 800px;
      margin-left: auto;
      margin-right: auto;
      box-shadow: 0 5px 15px rgba(0,0,0,0.1);
      position: relative;
      opacity: 0;
      transform: scale(0.95);
      transition: opacity 0.4s ease, transform 0.4s ease;
    }
    .details.active {
      display: block;
      opacity: 1;
      transform: scale(1);
    }
    .close-btn {
      position: absolute;
      top: 15px;
      right: 20px;
      font-size: 22px;
      color: #d32f2f;
      cursor: pointer;
    }
    h2 {
      margin-top: 0;
      font-size: 0.8rem;
    }
    ul {
        padding-left: 20px;
        font-size: 0.8rem;
    }
    .extra-info {
      margin-top: 15px;
      background-color: #EAF5FF;
      padding: 10px 15px;
      border-left: 5px solid #94CDFF;
      border-radius: 5px;
    }
    .label {
      font-weight: bold;
    }
    
    .cta-fixed {
      position: fixed;
      bottom: 0;
      left: 0;
      width: 100%;
      background: #2e7d32;
      color: white;
      text-align: center;
      padding: 15px 10px;
      box-shadow: 0 -3px 8px rgba(0,0,0,0.2);
      z-index: 999;
    }
    .cta-fixed p {
      margin: 0 0 8px 0;
      font-size: 1rem;
      font-weight: 500;
    }
    .cta-fixed a {
      display: inline-block;
      background: #ffffff;
      color: #2e7d32;
      font-size: 1.1rem;
      font-weight: bold;
      text-decoration: none;
      padding: 12px 25px;
      border-radius: 8px;
      transition: background 0.3s, color 0.3s;
    }
    .cta-fixed a:hover {
      background: #1b5e20;
      color: #fff;
    }

    .grid-container {
        display: grid;
        grid-template-columns: 1fr 1fr;
        grid-gap: 10px;
        font-size: 1.0em;
    }
    .grid-child-label{
        text-align: left;
    }
    .grid-child-value {
        text-align: right;
    }
    .compare {
        transform: scale(2.0);
    }
    .container {
          display: grid;
          grid-template-columns: 250px 250px 250px;
          grid-gap: 30px;
          justify-content: center;
          align-items: top;
          height: 50vh;
          font-family: 'Baloo Paaji 2', cursive;
      }
    .card {
        height: 10rem;
        border-radius: 5px;
        display: flex;
        flex-direction: column;
        align-items: center;
    }
    .card_name {
        margin-top: 20px;
        font-size: 1.5em;
        text-align: center;
    }
    .card_image {
        height: 128px;
        width: 128px;
        border-radius: 50%;
        border: 5px solid #2A9FDE;
        margin-top: 15px;
        box-shadow: 0 10px 50px rgba(150, 204, 251, 1);
    }
    .draw-border {
        box-shadow: inset 0 0 0 2px #AAD7FF;
        color: #21E499;
        -webkit-transition: color 0.25s 0.0833333333s;
        transition: color 0.25s 0.0833333333s;
        position: relative;
    }
    .draw-border::before,
    .draw-border::after {
        border: 0 solid transparent;
        box-sizing: border-box;
        content: '';
        pointer-events: none;
        position: absolute;
        width: 0rem;
        height: 0;
        bottom: 0;
        right: 0;
    }
    .draw-border::before {
        border-bottom-width: 2px;
        border-left-width: 2px;
    }
    .draw-border::after {
        border-top-width: 2px;
        border-right-width: 2px;
    }
    .draw-border:hover {
        color: #7FF658;
    }
    .draw-border:hover::before,
    .draw-border:hover::after {
        border-color: #21E499;
        -webkit-transition: border-color 0s, width 0.25s, height 0.25s;
        transition: border-color 0s, width 0.25s, height 0.25s;
        width: 100%;
        height: 100%;
    }
    .draw-border:hover::before {
        -webkit-transition-delay: 0s, 0s, 0.25s;
        transition-delay: 0s, 0s, 0.25s;
    }
    .draw-border:hover::after {
        -webkit-transition-delay: 0s, 0.25s, 0s;
        transition-delay: 0s, 0.25s, 0s;
    }
    .btn {
        background: none;
        border: none;
        cursor: pointer;
        line-height: 1.0;
        font: 200 1.2rem 'Roboto Slab', sans-serif;
        padding: 0.75em 1em;
        letter-spacing: 0.05rem;
        margin: 1em;
        width: 10rem;
    }
    .btn:focus {
        outline: 2px dotted #55d7dc;
    }
        </style>
    </head>
    <body>
        <h1>&nbsp;</h1>
      <div class="grid" id="grid"></div>
      <div class="details" id="details">
          <span class="close-btn" id="closeBtn">&times;</span>
          <div id="detail-steps" class="container">
              <!--<div id="detail-steps"></div> -->
          </div>
          <div id="extra-info"><button class="btn draw-border">Compare</button></div>
      </div>
      <script id="database">
        const categories = [
            {name:'Cameras',icon:'data:image/webp;base64,'},
            {name:'Accessories',icon:'data:image/webp;base64,'}
            ];
        const compare = [
       {
        name:'Cameras',
        icon:'üì∑',
        id: 1,
        brand:'Nikon<br>D7500 DSLR', 
        in_stock: 'Yes',
        rating: 4.9,
        price: 799.95,
        features: ['20.9 Megapixels',
                   'Large 3.2‚Äù 922K dot, tilting LCD screen with touch functionality',
                   'Shoots up to 8 fps',
                   '4K Ultra HD and 1080p Full HD video with stereo sound'],
        img: "data:image/webp;base64,"
      },
      {
        name:'Cameras',
        icon:'üì∑',
        id: 2,
        brand:'Nikon<br>D6 DSLR Camera', 
        in_stock: 'No',
        rating: 5.0,
        price: 6496.95,
        features: ['20.8 Megapixels at up to 10.5fps in complete silence',
                   '4K UHD 3840 x 2160 at 30/25/24p',
                   '3.2" wide viewing angle touch TFT-LCD',
                   'Pro-grade weather sealing',
                   'Shoots up to 14 fps',
                   'Built-in Bluetooth and Wi-Fi to instantly share your pictures'],
        img: "data:image/webp;base64,"
      },
      {
        name:'Cameras',
        icon:'üì∑',
        id: 3,
        brand:'Panasonic<br>LUMIX FZ80D', 
        in_stock: 'Yes',
        rating: 4.8,
        price: 549.99,
        features: ['18.1 Megapixels at 16:9 aspect ratio',
                   '3" color touch-screen LCD display',
                   '4K Video/Photo recording, and Power O.I.S. Optical Image Stabilizer',
                   '60x optical/ 4x digital/ 120x Intelligent Zoom',
                   '4K video capture'],
        img: "data:image/webp;base64,"
      }
    ];
      </script>
      <script id="business_logic">
          let params = new URLSearchParams(document.location.search);
          let localization = params.get("lang"); // is the string "Jonathan"
          //document.addEventListener('contextmenu', event => event.preventDefault());
          var cart = [];
 
          var ccy = new Intl.NumberFormat('en-US', {
                style: 'currency',
                currency: 'USD'
            });
          if(localization === "EUR") {
                ccy = new Intl.NumberFormat('de-DE', {
                style: 'currency',
                currency: 'EUR',
                });
            }
          const grid = document.getElementById('grid');
          const details = document.getElementById('details');
          const detailSteps = document.getElementById('detail-steps');
          const extraInfo = document.getElementById('extra-info');
          const closeBtn = document.getElementById('closeBtn');
    
          function add_to_cart(item_id) {
                cart.push(item_id);
                alert("Item added to cart.");
          }
    
          function clear_cart(){
            alert("Cart cleared");
            window.location.reload(false);
          }
    
          function purchase() {
                var sub_total = 0.0;
                detailSteps.innerHTML = '';
                if(cart.length > 0) {
                    for (let i = 0; i < compare.length; i++) {
                        for(let c = 0; c < cart.length; c++) {
                            if (compare[i].id === cart[c]) {
                                var item = compare.filter(item => item.id === cart[c]);
                                sub_total += item[0].price;
                            }
                        }
                    }
                details.innerHTML = `<div>\n<h4>Complete Your Purchase</h4>\nYour total is <b>${ccy.format(sub_total)}</b>`;
                details.innerHTML += `<img width="128px" src="data:image/webp;base64,">`;
                details.innerHTML += `<br>Your Receipt<br><img src="https://place-hold.it/200?text=QR%20Code%20here">`;
                details.innerHTML += `<br><button class="btn draw-border" onclick="clear_cart()">Clear Cart</button>`;
                details.innerHTML += `\n</div>`;
                }
          }
    
          categories.forEach((item, idx) => {
              const div = document.createElement('div');
              div.className = 'item';
              div.innerHTML = `<div class="icon"><img src="${item.icon}" /></div><div>${item.name}</div>`;
              div.addEventListener('click', () => showProducts(item.name));
              grid.appendChild(div);
            });
    
          function showProducts(index) {
                if(index != 'My Cart'){
                  detailSteps.innerHTML = '';
                  const items = compare.filter(items => items.name === index);
                  detailSteps.innerHTML = createCard(items);
                  details.classList.add('active');
                }
                else {
                    purchase();
                }
            }
    
          function createCard(items) {
                products = "";
                items.forEach(item => {
                    var btn = `<button class="btn draw-border" onclick="add_to_cart(${item.id})">Add To Cart</button>`;
                    if(item.in_stock === 'No'){
                        btn = '<button disabled class="btn">Out of Stock</button>';
                    }
                    var card = `<div class="card">
                        <img class="card_image" src="${item.img}" />
                        <p class="card_name">${item.brand}</p>
                        <div class="grid-container">
                            <div class="grid-child-label">Price:</div>
                            <div class="grid-child-value">${ccy.format(item.price)}</div>    
                            <div class="grid-child-label">Rating:</div>
                            <div class="grid-child-value">${item.rating}</div>    
                        </div>
                            <ul>
                                <li>${item.features[0]}</li>
                                <li>${item.features[1]}</li>
                                <li>${item.features[2]}</li>
                            </ul>
                            ${btn}
                            <button class="btn draw-border">Let Me Try</button>
                            <input type="checkbox" class="compare draw-border" name="chk${item.id}" value="${item.id}">
                        </div>`;
    
                products += card;
                });
                return products;
            }
        
        closeBtn.addEventListener('click', () =>
                    details.classList.remove('active')
                 );
     
      </script>
  </body>
</html>